import React, { useState } from 'react';
import './App.css';
import logo from './Pictures/plogo.png';
import { Button, Form, Container, Row, Col } from 'react-bootstrap';
import axios from "axios";

const Careers = () => {
  // Define state for form data
  const [formData, setFormData] = useState({
    firstName: "",
    lastName: "",
    email: "",
    message: ""
  });

  // Handle form input changes
  const handleChange = (event) => {
    const { name, value } = event.target;
    setFormData(prevState => ({
      ...prevState,
      [name]: value
    }));
  };

  // Handle form submission
  const handleSubmit = (event) => {
    event.preventDefault();
    // Make POST request to your backend
    axios.post('http://localhost:4000/ContactPage', formData)
      .then(response => {
        alert('Message sent successfully!');
        console.log(response.data);
      })
      .catch(error => {
        console.error('Failed to send message:', error);
        alert('Failed to send message.');
      });

    // Optionally reset form after sending
    setFormData({
      firstName: "",
      lastName: "",
      email: "",
      message: ""
    });
  };
  const NavbarComponent = () => {
    return (
      <nav className="navbar">
        <Container>
          <div className="logo">
            <img style={{ width: '200px', height: '80%' }} src={logo} alt="Logo" />
          </div>
          <ul className="nav-links">
            <li><a href="/valet-parking">Valet Parking</a></li>
            <li><a href="/commercial-services">Commercial Services</a></li>
            <li><a href="/locations">Locations</a></li>
            <li><a href="/Careers">Careers</a></li>
            <li><a href="/about">About</a></li>
            <li><a href="/ContactPage">Contact</a></li>
          </ul>
          <button className="quote-btn" style={{ padding:'13px', color:'black', fontSize:'20px'}}> <a href="Quote" style={{color:'black', textDecoration: 'none'  }}>Request a Quote</a> </button>
        </Container>
      </nav>
    );
  };

  return (

    <div>
     {NavbarComponent()}

      <Container>

          <Col>
            <div className="contact-details">
              <h2>Join Us.</h2>
              <p>careers@peninsulaparking.com</p>
              <p>(800)-758-2538</p>
              <p>541 Taylor Way<br />San Carlos, CA 94070 </p>
              <div className="social-media">
          <a          href="https://facebook.com"><i className="fab fa-facebook-f"></i></a>
          <a href="https://linkedin.com"><i className="fab fa-linkedin-in"></i></a>
          <a href="https://twitter.com"><i className="fab fa-twitter"></i></a>
          <a href="https://email.com"><i className="fas fa-envelope"></i></a>
        </div>
      </div>

      <div className="contact-map">
      <div>
        <h1 style={{background:'#195e3d', color: 'white', position: 'absolute'}}>Part Time Valet Parking Attemdents - Bay Area</h1>
        $25/hr and up to $28/hr with tips

Need extra income and like to drive cars?

Here at Peninsula Parking, we are looking for Full-Time, Part-Time, and Seasonal employees who are energetic, motivated, radiate positive energy, professional and possess a thorough understanding of customer service.

We valet at special events and fixed corporate locations throughout San Francisco, the Peninsula, South Bay, East Bay, and North Bay.

Peninsula Parking provides you with effective training programs and access to the seasoned management team to accelerate your self-growth. With a continuously expanding company, there are unlimited possibilities for you!

We welcome students and applicants with valet, retail, cashier, sales and customer service experience. Valet Attendant experience preferred but not required. We are willing to train the right individuals!

As a Valet Attendant, you are expected to:

Deliver great customer service by being helpful, courteous and enthusiastic
Drive and park a variety of vehicles efficiently and safely
Receive and deliver vehicles exceeding guests expectations
Maintain a well-groomed and professional appearance at all times
Treat our clients’ vehicles with great care always putting safety first
Lightly jog during busy hours to and from vehicles
Be punctual
Have excellent communication, both written and oral, and interpersonal skills
Drive manual transmission (preferred)
Be based within 20 miles of the Peninsula Bay Area (San Francisco to San Jose)
Open to working fixed locations and events
Valet Attendant Perks:

Growth and career opportunities
Paid orientation and training
Monthly recognition rewards
Medical, vision and dental insurance
Flexible schedules
Referral bonuses
Before you apply, you must meet these requirements:

Be at least 19 years of age
Have a valid driver’s license with no accidents or two-point driving infractions
Minimum 3 years of driving experience
Able to walk, run, or stand for up to 8 hours at a time
Able to lift up to 15 pounds
Willing to work outdoors in all weather conditions including rain
Customer service experience preferred (e.g. valet, retail, sales, cashier, receptionist)
*We’re an equal opportunity employer. All applicants will be considered for employment without attention to race, color, religion, sex, sexual orientation, gender identity, national origin, and veteran or disability status.*

        </div>
            </div>

          </Col>
          </Container>
          <Col>
            <div className="contact-form">
              <Form onSubmit={handleSubmit}>
                <Form.Group>
                  <Form.Label>First Name (required)</Form.Label>
                  <Form.Control type="text" name="firstName" value={formData.firstName} onChange={handleChange} required />
                </Form.Group>
                <Form.Group>
                  <Form.Label>Last Name</Form.Label>
                  <Form.Control type="text" name="lastName" value={formData.lastName} onChange={handleChange} />
                </Form.Group>
                <Form.Group>
                  <Form.Label>Email (required)</Form.Label>
                  <Form.Control type="email" name="email" value={formData.email} onChange={handleChange} required />
                </Form.Group>
                <Form.Group>
                  <Form.Label>Message (required)</Form.Label>
                  <Form.Control as="textarea" name="message" value={formData.message} onChange={handleChange} required />
                </Form.Group>
                <Button type="submit">Send</Button>
              </Form>
            </div>
          </Col>


    </div>
  );
};

export default Careers;
